import React, { useState } from 'react';

const HealthInsuranceCard: React.FC = () => {
  const [isExpanded, setIsExpanded] = useState(false);
  const [showForm, setShowForm] = useState(false);

  const handleBookSafetyCall = () => {
    setShowForm(true);
  };

  const handleCloseForm = () => {
    setShowForm(false);
  };

  return (
    <>
      <div className="relative health-card-container">
        {/* Base Health Insurance Card */}
        <div 
          className={`relative w-[300px] h-[170px] bg-light-gray rounded-[20px] p-6 health-card-base cursor-pointer ${
            isExpanded ? 'z-20' : 'z-10'
          }`}
          onMouseEnter={() => setIsExpanded(true)}
          onMouseLeave={() => setIsExpanded(false)}
        >
          {/* Card Content */}
          <div className="flex justify-between items-start h-full">
            <div className="flex flex-col justify-between h-full">
              {/* Title */}
              <h3 className="font-satoshi font-normal text-[32px] text-design-black leading-[1.16em]">
                Health
              </h3>
              {/* Description */}
              <p className="font-satoshi font-light text-[17px] text-design-black leading-[1.16em] max-w-[150px]">
                Stay healthy,<br />stay wealthy
              </p>
            </div>
            {/* Icon */}
            <img 
              src="/images/healthcare-icon.png" 
              alt="Healthcare Icon" 
              className="w-[48px] h-[48px] object-contain"
            />
          </div>
        </div>

        {/* Expanded Content - Overlay */}
        <div 
          className={`absolute top-0 left-0 w-[300px] bg-light-gray rounded-[20px] health-card-expanded overflow-hidden shadow-xl ${
            isExpanded ? 'h-[364px] opacity-100 z-30' : 'h-[170px] opacity-0 pointer-events-none'
          }`}
          onMouseEnter={() => setIsExpanded(true)}
          onMouseLeave={() => setIsExpanded(false)}
        >
          {/* Expanded Content Container */}
          <div className="p-6 h-full flex flex-col">
            {/* Header Section - Only Title and Icon */}
            <div className="flex justify-between items-start mb-6">
              <div className="space-y-5">
                <h3 className="font-satoshi font-normal text-[32px] text-design-black leading-[1.16em]">
                  Health
                </h3>
                {/* Description removed from expanded view */}
              </div>
              <img 
                src="/images/healthcare-icon.png" 
                alt="Healthcare Icon" 
                className="w-[48px] h-[48px] object-contain"
              />
            </div>

            {/* Healthcare Statistics Content */}
            <div className="flex-1 space-y-4">
              {/* Bullet Points */}
              <div className="space-y-3">
                {/* First Bullet Point */}
                <div className="flex items-start space-x-2">
                  <span className="w-1.5 h-1.5 bg-design-black rounded-full mt-2 flex-shrink-0"></span>
                  <p className="font-satoshi font-light text-[15px] text-design-black leading-[1.4em]">
                    Indians still pay 45.98% of all healthcare costs out-of-pocket one medical bill can wipe out savings.
                  </p>
                </div>

                {/* Second Bullet Point */}
                <div className="flex items-start space-x-2">
                  <span className="w-1.5 h-1.5 bg-design-black rounded-full mt-2 flex-shrink-0"></span>
                  <p className="font-satoshi font-light text-[15px] text-design-black leading-[1.4em]">
                    ₹ 70,558 — average health-claim size in FY 24, up 11% YoY thanks to medical inflation.
                  </p>
                </div>
              </div>
            </div>

            {/* CTA Button */}
            <div className="pt-4">
              <button 
                onClick={handleBookSafetyCall}
                className="bg-primary-blue text-button-text font-satoshi font-bold px-4 py-2.5 rounded-[10px] hover:bg-blue-700 transition-colors text-[14px] shadow-md"
              >
                Book Safety Call
              </button>
            </div>
          </div>
        </div>
      </div>

      {/* Full Screen Form Modal */}
      {showForm && (
        <div className="fixed inset-0 bg-black bg-opacity-50 z-50 flex items-center justify-center p-4">
          <div className="bg-light-gray rounded-[20px] p-8 max-w-md w-full max-h-[90vh] overflow-y-auto">
            {/* Form Header */}
            <div className="flex justify-between items-start mb-6">
              <h3 className="font-satoshi font-normal text-[32px] text-design-black leading-[1.16em]">
                Health
              </h3>
              <button 
                onClick={handleCloseForm}
                className="text-design-black hover:text-gray-600 text-2xl font-bold"
              >
                ×
              </button>
            </div>

            {/* Form Content */}
            <div className="space-y-4">
              {/* Form Fields */}
              <div className="space-y-4">
                {/* Phone No. */}
                <div>
                  <label className="block font-satoshi font-normal text-[14px] text-design-black mb-2">
                    Phone No.:
                  </label>
                  <input 
                    type="tel" 
                    className="w-full px-4 py-3 bg-white rounded-[8px] border border-gray-300 focus:outline-none focus:border-primary-blue text-[14px]"
                    placeholder="Enter phone number"
                  />
                </div>

                {/* Age */}
                <div>
                  <label className="block font-satoshi font-normal text-[14px] text-design-black mb-2">
                    Age:
                  </label>
                  <input 
                    type="number" 
                    className="w-full px-4 py-3 bg-white rounded-[8px] border border-gray-300 focus:outline-none focus:border-primary-blue text-[14px]"
                    placeholder="Enter age"
                  />
                </div>

                {/* Dependents */}
                <div>
                  <label className="block font-satoshi font-normal text-[14px] text-design-black mb-2">
                    Dependents:
                  </label>
                  <input 
                    type="number" 
                    className="w-full px-4 py-3 bg-white rounded-[8px] border border-gray-300 focus:outline-none focus:border-primary-blue text-[14px]"
                    placeholder="Number of dependents"
                  />
                </div>

                {/* Target sum insured */}
                <div>
                  <label className="block font-satoshi font-normal text-[14px] text-design-black mb-2">
                    Target sum insured:
                  </label>
                  <input 
                    type="text" 
                    className="w-full px-4 py-3 bg-white rounded-[8px] border border-gray-300 focus:outline-none focus:border-primary-blue text-[14px]"
                    placeholder="Enter target amount"
                  />
                </div>
              </div>

              {/* Form Buttons */}
              <div className="pt-6 flex gap-3">
                <button 
                  onClick={handleCloseForm}
                  className="flex-1 bg-gray-300 text-design-black font-satoshi font-bold px-4 py-3 rounded-[10px] hover:bg-gray-400 transition-colors text-[14px]"
                >
                  Cancel
                </button>
                <button 
                  className="flex-1 bg-primary-blue text-button-text font-satoshi font-bold px-4 py-3 rounded-[10px] hover:bg-blue-700 transition-colors text-[14px] shadow-md"
                >
                  Schedule Safety Call
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default HealthInsuranceCard;
